import './App.css';
import Navbar from './components/Navbar';
import Mid from './components/Mid';

function App() {
  return (
    <>
    <Navbar></Navbar>
    <div className="text-center container-fluid">
    <img className='img-responsive center-block d-block mx-auto' src="https://alpineriverhill.com/assets/img/slider/1.jpg"height={653} width={1430} />
    </div>
    <Mid></Mid>
    </>
  );
}

export default App;
